import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';

@Component({
  selector: 'app-picks',
  standalone: true,
  imports: [CommonModule],
  template: `
    <div class="min-h-screen bg-gray-50 p-6">
      <div class="max-w-7xl mx-auto">
        <h1 class="text-2xl font-bold text-gray-900 mb-6">My Picks</h1>
        <div class="card p-6 text-center">
          <p class="text-gray-600">Picks component is ready for development!</p>
          <p class="text-sm text-gray-500 mt-2">This will allow users to make and manage their weekly picks.</p>
        </div>
      </div>
    </div>
  `
})
export class PicksComponent {}
